import React, { Component } from "react";
import TeamUserAvatar from "./team/TeamUserAvatar";
import { Link } from "react-router-dom";
import { Menu, Image } from "semantic-ui-react";

class NavBar extends Component {
  render() {
    const { loggedIn, user, logout } = this.props;
    return (
      <div className="nav-bar">
        {loggedIn ? (
          <Menu fluid color="blue" inverted widths={4}>
            <Menu.Header>{user.username}</Menu.Header>
            <Menu.Item>
              <Image circular src={user.img_url} />
            </Menu.Item>
            <Menu.Item>
              <Link textAlign="right" to="/login" onClick={logout}>
                Log Out
              </Link>
            </Menu.Item>
          </Menu>
        ) : null}
      </div>
    );
  }
}

export default NavBar;
